import PopupWithForm from './PopupWithForm';

function ConfirmPopup({isOpen, onClose}) {
    return (
        <PopupWithForm
        title='Вы уверены'
        name='confirm'
        btnName='Да'
        isOpen={isOpen}
        onClose={onClose}>
        </PopupWithForm>
    );
}

export default ConfirmPopup;
